ScriptEntity.script:
function main(c) {
    let player = c.getPlayer(); 

    player.setPosition(224, 56, 87); 
    player.setRotations(90, 180, 0); 
    c.getServer().send("Player " + player.getName() + " has changed his location.", false);
}

